import React from "react";

const RecipeFilters = ({ filters }) => {
  return (
    <div
      className="bgLightGray col-auto btn-group-vertical"
      role="group"
      aria-label="Recipe filters"
    >
      <div>Filters</div>
      {filters}
      <input
        type="radio"
        className="btn-check"
        name={filter.name}
        id={filter._id}
      />
      <label className="btn" for={filter.name}>
        {filter.name}
      </label>
    </div>
  );
};

export default RecipeFilters;
